import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter as Router, Route, Link, useHistory} from 'react-router-dom'

import {
    LoginForm, 
    LogOut, 
    Posts, 
    Profile, 
    Register
} from "./components";

import { authToken } from './components/LoginForm';

const App = () => {
//   const history = useHistory()
//   <Route path ="/red" component ={red}
// button onclick={() => history.pushState("/red")}

    return(
        <Router>
        <div className='app'>

            <div id='navigation'>
            <Link to="/">Stranger Things</Link>
            <Link to="/posts">Posts</Link>
            <Link to="/profile">Profile</Link>
            <Link to="/login">{authToken ? "Log Out" : "Log In"}</Link>
            </div>
<h1>Hello world</h1>
<div id='main-section'>
<Route path="/login">
         <LoginForm />
         </Route>
       <Route path="/posts">
         <Posts />
         </Route>
         <Route path="/profile">
           <Profile />
         </Route>
         <Route  path="/logout">
           <LogOut />
         </Route>
         <Route path="/register">
         <Register />
         </Route>

      </div>
</div>
</Router>
    )
}

ReactDOM.render(
    <App />,
    document.getElementById('app')
  )
